import React, { useEffect } from 'react'
import axios from 'axios'
function Home  ({token})  {

  useEffect(()=>{
    fetchData(token);
  },[token])
  const fetchData = async(token) => {
    const res = axios.get("http://localhost.5000/api/todos", {headers: {
      Authorization: 'Bearer' + token,
    }});

    console.log(res.data);
   
  }
  return (
    <div>
      <h1>Hello</h1>
    </div>
  )
}

export default Home
